import React from 'react'
import { Container } from 'react-bootstrap'
// import './footer.css';
// import '.style.css'

const footer = (props) => {
    const  first= {
       color:"red",
       backgroundColor:"yellow",
       display:"flex",
       justifyItems:"center"
    }
    const {details1,details2}=props;
  return (
    
        <footer className="bg-light">
            <Container style={first}>
            <div className="col-4" >
               {details1}
            </div>
            <Container className='col-4'>
                {details2}
            </Container>
            <Container className=''>
            {details2}
            </Container>
            </Container>
       
        </footer>
        
    
  )
}

export default footer
